import React, { Component } from "react";
import {
  Inject,
  ScheduleComponent,
  Day,
  Week,
  Month,
  WorkWeek,
  Agenda,
  ResourceDirective,
} from "@syncfusion/ej2-react-schedule";

class Calender extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      members: [],
    };
  }

  async componentDidMount() {
    await fetch("http://localhost:3000/members")
      .then(async (res) => await res.json())
      .then((json) => {
        this.setState({
          isLoaded: true,
          members: json,
        });
      });
  }

  //localData = members;

  render() {
    return (
      <ScheduleComponent>
        <Inject services={[Day, Week, Month, Agenda]} />
      </ScheduleComponent>

      // <ScheduleComponent
      //   height="550px"
      //   selectedDate={new Date(2019, 4, 8)}
      //   eventSettings={{ dataSource: this.members }}
      // >
      //   {/* <ResourceDirective>
      //     <ResourceDirective field="ResourceID"></ResourceDirective>
      //   </ResourceDirective> */}
      // </ScheduleComponent>
    );
  }
}

export default Calender;
